(1003, 101, 502, '<p>bạn h&atilde;y d&ugrave;ng&nbsp;&nbsp;<a href=\"https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-wildcard-query.html\">wildcard</a>&nbsp;query:</p>\n<pre class=\"language-markup\"><code>GET /my_index/table_name/_search\n{\n    \"query\": {\n        \"wildcard\": {\n            \"field_name\": \"a*\"\n        }\n    }\n}</code></pre>\n<p>hoặc&nbsp;<a href=\"https://www.elastic.co/guide/en/elasticsearch/guide/current/prefix-query.html\">Prefix query</a>:</p>\n<pre class=\"language-markup\"><code>GET /my_index/table_name/_search\n{\n    \"query\": {\n        \"prefix\": {\n            \"field_name\": \"a\"\n        }\n    }\n}</code></pre>\n<p>hy vọng n&oacute; c&oacute; thể gi&uacute;p bạn&nbsp;<img src=\"https://cloud.tinymce.com/stable/plugins/emoticons/img/smiley-laughing.gif\" alt=\"laughing\" /></p>', 0, 1, '2018-07-22 08:19:25', '2018-07-22 08:21:29'),
(1004, 103, 503, '<p>c&acirc;u trả lời cho bạn&nbsp;<img src=\"https://cloud.tinymce.com/stable/plugins/emoticons/img/smiley-tongue-out.gif\" alt=\"tongue-out\" /></p>\n<pre class=\"language-javascript\"><code>//Get\nvar bla = $(\'#txt_name\').val();\n\n//Set\n$(\'#txt_name\').val(bla);</code></pre>', 0, 1, '2018-07-22 08:28:03', '2018-07-22 08:28:03'),
(1006, 101, 504, '<p>h&atilde;y thử c&aacute;ch n&agrave;y:</p>\n<pre class=\"language-markup\"><code>document.body.innerHTML = document.body.innerHTML.replace(\'hello\', \'hi\');</code></pre>', 0, 1, '2018-07-22 08:57:04', '2018-07-22 08:57:04'),
