(501, 103, 1, 'Html cơ bản-lập trình web', 'html-co-ban-lap-trinh-web', 'Tìm hiểu các thành phần cơ bản của trang web', '<p><strong>Mục ti&ecirc;u m&ocirc;n học</strong><br />-Cung cấp c&aacute;c kiến thức cơ bản về thiết kế web<br />-HTML, CSS, JavaScript<br />-T&igrave;m hiểu c&aacute;c th&agrave;nh phần cơ bản của trang web<br />-C&aacute;c bước x&acirc;y dựng trang web tĩnh<br />-X&acirc;y dựng &amp; triển khai trang web tĩnh.<br />-Sử dụng c&ocirc;ng cụ thiết kế web phổ biến như<br />Dreamweaver, v&agrave; c&aacute;c c<br /><strong>Nội dung m&ocirc;n học</strong><br />-Phần 1: kiến thức cơ bản<br />- HTML (HyperText Markup Language)<br />- CSS (Cascading Style Sheets)<br />- Ng&ocirc;n ngữ JavaScript.<br />- Phần 2: c&ocirc;ng cụ thiết kế web<br />- Dreamweaver<br />- Photoshop<br />- Flash<br />- Một số c&ocirc;ng cụ hỗ trợ thiết kế web kh&aacute;c.<br /><strong>Giới thiệu m&ocirc;n học</strong><br />- Giảng vi&ecirc;n:<br />- ThS. Nguyễn H&agrave; Giang<br />- C&aacute;c m&ocirc;n dạy:<br />- Kỹ thuật lập tr&igrave;nh, CTDL &amp; GT, OOP, Lập tr&igrave;nh Visual C++ &amp;<br />MFC, Lập tr&igrave;nh C# Desktop Application, LT Web Application<br />ASP.NET, M&atilde; nguồn mở (PHP &amp; MySQL), CC&amp;MT PTPM.<br />- Hướng nghi&ecirc;n cứu:<br />- Data Mining, Fuzzy Data Mining, Fuzzy Association Rule<br />Mining<br />- Semantic Web Mining,<br />- Email: nguyenha.giang@yahoo.com</p>', 'https://www.mediafire.com/file/fbswfzu8wk3jst3/HtmlCoBan_kungfuphp.com.pdf', 0, 1, '2018-07-22 09:05:17', '2018-07-22 09:08:08');
INSERT INTO `documentations` (`id`, `user_id`, `subject_id`, `title`, `title_url`, `summary`, `content`, `link`, `view`, `is_new`, `created_at`, `updated_at`) VALUES
(502, 102, 1, 'Học lập trình Java qua 9 tài liệu Java chọn lọc này', 'hoc-lap-trinh-java-qua-9-tai-lieu-java-chon-loc-nay', 'Học lập trình Java qua 9 tài liệu bằng cả tiếng Việt và tiếng Anh do ITviec chọn lọc', '<h3><strong>Java l&agrave; g&igrave;?</strong></h3>\n<p>Java l&agrave; ng&ocirc;n ngữ lập tr&igrave;nh hướng đối tượng (OOP), đa mục đ&iacute;ch v&agrave; độc lập nền tảng. Thay v&igrave; bi&ecirc;n dịch m&atilde; nguồn th&agrave;nh m&atilde; m&aacute;y tr&ecirc;n nền tảng cụ thể, code Java được bi&ecirc;n dịch th&agrave;nh bytecode &ndash; một định dạng trung gian. Bytecode sau đ&oacute; sẽ được chạy bởi m&ocirc;i trường thực thi (runtime environment).</p>\n<p>N&oacute;i c&aacute;ch kh&aacute;c, code Java &ldquo;viết một lần, chạy mọi nơi&rdquo;. N&oacute; sẽ l&agrave;m việc &ldquo;l&yacute; tưởng&rdquo; tr&ecirc;n bất k&igrave; thiết bị chạy hệ điều h&agrave;nh n&agrave;o, miễn l&agrave; được c&agrave;i đặt Java Runtime Environment (JRE).</p>\n<p>Ng&ocirc;n ngữ Java được thiết kế bởi James Gosling v&agrave; đồng nghiệp tại Sun Microsystems năm 1991. Sau n&agrave;y, Oracle mua lại Sun Microsystems v&agrave; tiếp quản c&ocirc;ng nghệ Java với cam kết &ldquo;kh&ocirc;ng ngừng th&uacute;c đẩy một cộng đồng năng động v&agrave; minh bạch.&rdquo;</p>\n<h3><strong>Tại sao n&ecirc;n học lập tr&igrave;nh Java?</strong></h3>\n<p>Theo khảo s&aacute;t nhanh của ITviec, tại Việt Nam, lập tr&igrave;nh Java lu&ocirc;n l&agrave; một trong những kĩ năng&nbsp;<strong>được c&aacute;c c&ocirc;ng ty săn đ&oacute;n v&agrave; trả lương cao</strong>&nbsp;nhất, c&oacute; thể l&ecirc;n tới $3000 cho vị tr&iacute; Senior Java Developer!</p>\n<p>Cơ hội việc l&agrave;m cho lập tr&igrave;nh vi&ecirc;n Java cũng hết sức phong ph&uacute; với&nbsp;<strong>h&agrave;ng trăm vị tr&iacute; tuyển dụng thường xuy&ecirc;n</strong>, cả ở start-up lẫn c&aacute;c tập đo&agrave;n lớn.</p>\n<p>Ngo&agrave;i ra, ng&ocirc;n ngữ lập tr&igrave;nh Java c&ograve;n hấp dẫn bởi c&aacute;c l&iacute; do sau:</p>\n<ul>\n<li><strong>Miễn ph&iacute;.</strong></li>\n</ul>\n<p>Trong ng&agrave;nh ph&aacute;t triển phần mềm, chi ph&iacute; l&agrave; vấn đề quan trọng cần c&acirc;n nhắc khi chọn lựa c&ocirc;ng nghệ.&nbsp;Ch&iacute;nh v&igrave; vậy, việc Java miễn ph&iacute; ngay từ đầu gi&uacute;p n&oacute; c&agrave;ng được c&aacute;c tổ chức v&agrave; lập tr&igrave;nh vi&ecirc;n ưu &aacute;i.</p>\n<ul>\n<li><strong>Bộ sưu tập thư viện m&atilde; nguồn mở phong ph&uacute;.</strong></li>\n</ul>\n<p>Apache, Google v&agrave; những tổ chức lớn kh&aacute;c đ&atilde; đ&oacute;ng g&oacute;p rất nhiều v&agrave;o c&aacute;c thư viện m&atilde; nguồn mở, gi&uacute;p Java ph&aacute;t triển nhanh v&agrave; dễ d&agrave;ng hơn, đồng thời tiết kiệm chi ph&iacute; hơn. Trước khi lập tr&igrave;nh một chức năng, bạn n&ecirc;n thử google đ&atilde;, v&igrave; c&oacute; khả năng l&agrave; n&oacute; đ&atilde; được một ai đ&oacute; viết code, test sẵn.</p>\n<p>V&agrave; cũng nhờ bộ sưu tập thư viện m&atilde; nguồn mở đồ sộ m&agrave; Java &ldquo;phủ s&oacute;ng&rdquo; khắp mọi nơi.</p>\n<ul>\n<li><strong>Hỗ trợ l&agrave;m t&agrave;i liệu với Javadoc.</strong></li>\n</ul>\n<p>Javadoc l&agrave; c&ocirc;ng cụ do Sun Microsystems ph&aacute;t triển, d&ugrave;ng để tạo API documentation với định dạng HTML từ Java source code. Định dạng HTML gi&uacute;p việc hyperlink c&aacute;c t&agrave;i liệu li&ecirc;n quan với nhau dễ d&agrave;ng hơn.</p>\n<p>B&ecirc;n cạnh đ&oacute;, Javadoc cũng cung cấp một API để tạo doclets v&agrave; taglets, gi&uacute;p người d&ugrave;ng ph&acirc;n t&iacute;ch cấu tr&uacute;c của một ứng dụng Java.</p>', 'https://drive.google.com/file/d/0B-hV1HrMP8j1NGVLM3RYa1hlX28/edit', 0, 1, '2018-07-22 09:11:23', '2018-07-22 09:12:01'),
(503, 104, 1, 'Giáo trình Lập trình .Net', 'giao-trinh-lap-trinh-net', 'Giáo trình Lập trình .Net được biên soạn nhằm mục đích cung cấp những kiến thức cơ bản về lập trình trong môi trường', '<p style=\"text-align: justify;\">Gi&aacute;o tr&igrave;nh Lập tr&igrave;nh .Net được bi&ecirc;n soạn nhằm mục đ&iacute;ch cung cấp những kiến thức cơ bản về lập tr&igrave;nh trong m&ocirc;i trường .Net của Microsoft. Với gi&aacute;o tr&igrave;nh n&agrave;y sinh vi&ecirc;n sẽ c&oacute; được c&aacute;c kiến thức về lập tr&igrave;nh để tạo ra c&aacute;c dạng ứng dụng kh&aacute;c nhau, bao gồm: ứng dụng d&ograve;ng lệnh (Console Application), ứng dụng giao diện windows (Windows Application) v&agrave; ứng dụng giao diện web (ASP.NET Website Application). V&igrave; đ&acirc;y l&agrave; phi&ecirc;n bản đầu ti&ecirc;n n&ecirc;n gi&aacute;o tr&igrave;nh n&agrave;y c&ograve;n c&oacute; những thiếu s&oacute;t, hạn chế. T&aacute;c giả mong nhận được sự g&oacute;p...</p>', 'https://tailieu.vn/doc/giao-trinh-lap-trinh-net-1237435.html', 0, 1, '2018-07-22 09:15:55', '2018-07-22 09:15:55'),
(504, 101, 2, 'Full bộ giáo trình Office 2010 giúp bạn trở thành master Tin Văn Phòng', 'full-bo-giao-trinh-office-2010-giup-ban-tro-thanh-master-tin-van-phong', 'Kĩ năng tin học văn phòng là một trong những kĩ năng cơ bản nhất mà bất kể ai cũng cần phải biết trong thời đại hiện nay', '<p><strong>Kĩ năng tin học văn ph&ograve;ng l&agrave; một trong những kĩ năng cơ bản nhất m&agrave; bất kể ai cũng cần phải biết trong thời đại hiện nay . V&igrave; vậy , m&igrave;nh xin gửi đến c&aacute;c bạn bộ gi&aacute;o tr&igrave;nh Office 2010 với hơn 60 b&agrave;i giảng đầy đủ v&agrave; chi tiết nhất bằng video bao gồm c&aacute;c b&agrave;i về Word , Excel v&agrave; Powerpoint . Hi vọng kh&oacute;a học n&agrave;y sẽ gi&uacute;p c&aacute;c bạn sẽ nắm vững được bộ c&ocirc;ng cụ thần th&aacute;nh của MS v&agrave; l&agrave;m chủ được kĩ năng tin học cơ bản của bản th&acirc;n . Ch&uacute;c c&aacute;c bạn th&agrave;nh c&ocirc;ng !</strong></p>', 'https://drive.google.com/file/d/1NuWRZDZBSiyzzYjo8IK7qHMlj3MX0wLV/view', 0, 1, '2018-07-22 09:19:39', '2018-07-22 09:19:39');
