(501, 101, 'Set giá trị option bằng getElementsByName()', 'set-gia-tri-option-bang-getelementsbyname-', '<p>T&ocirc;i c&oacute;&nbsp;fieldset:</p>\n<pre class=\"language-javascript\"><code>&lt;fieldset&gt;\n    &lt;legend&gt;[*death]&lt;/legend&gt;\n    &lt;select name=death  style=\"width: 120px\"&gt;\n        &lt;option value=Dead&gt;[*died]\n        &lt;option value=NotDead&gt;[*alive]\n        &lt;option value=\"\" selected&gt;-\n    &lt;/select&gt;\n&lt;/fieldset&gt;</code></pre>\n<p>b&acirc;y giờ t&ocirc;i muốn d&ugrave;ng javascript để set option thứ 2 được selected, t&ocirc;i đ&atilde; thử c&aacute;ch n&agrave;y nhưng kh&ocirc;ng được:</p>\n<pre class=\"language-javascript\"><code>document.getElementsByName(\'death\')[2].checked = \'true\';</code></pre>\n<p>mong mọi người c&oacute; thể chỉ t&ocirc;i c&aacute;ch?</p>', 8, 1, '2018-07-22 07:58:35', '2018-07-22 08:49:15'),
