(503, 104, 'lấy giá trị input bằng javascript?', 'lay-gia-tri-input-bang-javascript-', '<p>tối c&oacute; đoạn m&atilde; n&agrave;y:</p>\n<pre class=\"language-javascript\"><code>&lt;script type=\"text/javascript\" src=\"http://code.jquery.com/jquery-1.4.3.min.js\" &gt;&lt;/script&gt;\n&lt;script type=\"text/javascript\"&gt;\n    $(document).ready(function(){\n        $(\"#txt_name\").keyup(function(){\n            alert($(this).val());\n        });\n    })\n&lt;/script&gt;\n\n&lt;input type=\"text\" id=\"txt_name\"  /&gt;</code></pre>\n<p>&nbsp;</p>', 11, 1, '2018-07-22 08:26:42', '2018-07-22 08:50:59'),
(504, 103, 'Làm sao để thay thế giá trị text bằng Jquery?', 'lam-sao-de-thay-the-gia-tri-text-bang-jquery-', '<p>Giống như thay thế từ \"hello\" th&agrave;nh \"Hi\"</p>\n<pre class=\"language-markup\"><code>&lt;div class=\"replace\"&gt;hello&lt;/div&gt;\n</code></pre>', 17, 1, '2018-07-22 08:55:25', '2018-07-22 10:03:15');
